@DarrenCurtis_Christies offering one of Australia's finest waterfront residences with a guide of AUD $20,000,000 plus - Known as Mandalay House located in Airlie Beach, Queensland.

The Mediterranean inspired residence took 3.5 years to construct with no cost spared in its creation. The home rests on a private 4,242sqm with a palatial 2,649sqm of living and entertaining, pool and marina. Marble finishes, high ceilings, exquisite joinery, expansive living and sitting areas, banquet sized dining. Games room plus home theatre with tiered seating, projector, screen and sound, gymnasium, ducted a/c. Six further king-sized bedrooms with ensuite and sitting, car accommodation for five, lift access.

